import React from 'react';
import './Bracelet.css';
import bannerLeft from './images/banner-left.jpg'; // replace with your left image
import bannerRight from './images/banner-right.jpg'; // replace with your right image
import productImg1 from './images/product1.jpg'; // use actual product images

const Bracelet = () => {
  const subcategories = ["Pendant", "Pearl", "Statement", "Initial", "Emerald"];

  const products = [
    { name: "Paperclip Style Bracelet", price: 1899.99, image: productImg1, tag: "BUY 1 GET 1 FREE", rating: 4 },
    { name: "Statement Paperclip Earring", price: 1899.99, image: productImg1, tag: "BUY 1 GET 1 FREE", rating: 4 },
    { name: "Small Black Heart Ring", price: 1899.99, image: productImg1, rating: 4 },
    { name: "Twisted Hoop Earring", price: 1899.99, image: productImg1, rating: 5 },
    // Add more products
  ];

  return (
    <div className="bracelet-page">
      {/* Banner */}
      <div className="banner-section">
        <div className="banner-left">
          <img src={bannerLeft} alt="Bracelet banner left" />
        </div>
        <div className="banner-right">
          <h1>Necklaces</h1>
          <p>Grace Your Necklace with Timeless Elegance.</p>
          <img src={bannerRight} alt="Bracelet banner right" style={{ width: "200px", marginTop: "1rem" }} />
        </div>
      </div>

      {/* Subcategories */}
      <div className="subcategories">
        {subcategories.map((cat, index) => (
          <h3 key={index}>{cat}</h3>
        ))}
      </div>

      {/* Product Grid */}
      <div className="product-grid">
        {products.map((prod, index) => (
          <div className="product-card" key={index}>
            {prod.tag && <span className="tag">{prod.tag}</span>}
            <img src={prod.image} alt={prod.name} />
            <h4>{prod.name}</h4>
            <p>‚Çπ{prod.price}</p>
            <div className="rating">{"‚≠ê".repeat(prod.rating)}</div>
          </div>
        ))}
      </div>

      {/* Footer Info */}
      <div className="footer-info">
        <div>üöö Express Shipping</div>
        <div>üîÅ Easy Return & Exchange</div>
        <div>üîí Secure Payments</div>
      </div>
    </div>
  );
};

export default Bracelet;
